  "ru-RU": ["Имя пользователя:", "Пароль:", "Подтверждение пароля:", "E-mail:", "Зарегистрироваться", "Первый язык"],
  "pt-PT": ["Nome de usuário:", "Senha:", "Confirmação de senha:", "E-mail:", "Registrar", "Primeiro Idioma"],
  "ko-KR": ["사용자 이름:", "비밀번호:", "비밀번호 확인:", "이메일:", "등록", "주요 언어"],
  "it-IT": ["Nome utente:", "Password:", "Conferma password:", "Email:", "Registrati", "Prima Lingua"],
